\begin{tabular}{l}
	\Xhline{1pt}
	\textbf{Algorithm 2}: Solve the NR model () via ADMM
	\\
	\hline
	\textbf{Input:} Query sample $\bm{y}$, training sample matrix $\bm{X}$, $\text{Tol}>0$, $T$, $\rho>0$;
	\\
	\textbf{Initialization:} $\bm{c}_{0}=\bm{z}_{0}=\bm{\delta}_{0}=\bm{0}$, $t=0$;
	\\
	\textbf{for} $t=0:T-1$ \textbf{do}
	\\
	1. Update $\mathbf{c}_{t+1}$ as
	$
		\bm{c}_{t+1}
		=
		(\bm{X}^{\top}\bm{X}+\frac{\rho}{2}\bm{I})^{-1}
		(\bm{X}^{\top}\bm{y}+\frac{\rho}{2}\bm{z}_{t}+\frac{1}{2}\bm{\delta}_{t})
	$;
	\\
	2. Update $\mathbf{z}_{t+1}$ as
	$
		\bm{z}_{t+1}=\max(0,\bm{c}_{t+1}-\rho^{-1}\bm{\delta}_{t})
	$;
	\\
	3. Update $\bm{\delta}_{t+1}$ as
	$
		\bm{\delta}_{t+1}
		=
		\bm{\delta}_{t} + \rho(\bm{z}_{t+1}-\bm{c}_{t+1})
	$;
	\\
	\quad \textbf{if} (Convergence condition is satisfied)
	\\
	4.\quad Stop;
	\\
	\quad \textbf{end if}
	\\
	\textbf{end for}
	\\
	\textbf{Output:} Coding vectors $\bm{z}_T$ and $\bm{c}_T$.
	\\
	\Xhline{1pt}
\end{tabular}

